import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./styles.css";

function Header(props) {
    return (
      <div className="card">
        <ul>
          <li>
            <Link to="/">Search</Link>
          </li>
          <li>
            <Link to="/saved">Saved</Link>
          </li>
        </ul>
      </div>
    );
  }

  export default Header;
